        {
            string[] BaudRateData = { "75", "110", "134", "150", "300", "600", "1200", "1800", "2400", "4800", "7200", "9600", "14400", "19200", "38400", "57600", "115200", "128000" };
            
            BaudRate_ComboBox.Items.AddRange(BaudRateData);
        }

        private void Open_Close_Button_Click(object sender, EventArgs e)
        {
            if (serialPort1.IsOpen)
            {
                serialPort1.Close();
                Open_Close_Button.Text = "打开串口";
            }
            else
            {
                serialPort1.PortName = this.PortsName_ComboBox.Text;
                serialPort1.BaudRate = int.Parse(this.BaudRate_ComboBox.Text);
                try
                {
                    serialPort1.Open();
                    if (serialPort1.IsOpen)
                    {
                        Open_Close_Button.Text = "关闭串口";
                    }
                }
                catch (Exception err)
                {

                    throw;
                }
            }
        }
        
        
        
        private void Write() {
            
            for (int i = 0; i < Image.Length; i++)
            {
                serialPort1.Write(Image[i]);
                Reception_ListBox2.Items.Add("发送：" + Image[i] + " \x0a");
            }
            Reception_ListBox2.Items.Add("发送完毕" + " \x0a");
            

        }
        private void Read() {
            serialPort1.ReadLine();

        }

        private void Write_TextBox_TextChanged(object sender, EventArgs e)
        {
          
        }

        private void Write_Button_Click(object sender, EventArgs e)
        {
            if (!serialPort1.IsOpen)
            {

            }
            else
            {
                WriteString = Write_TextBox.Text;
                serialPort1.Write(WriteString);

                Reception_ListBox2.Items.Add("发送：" + WriteString + " \x0a");
                Write_TextBox.Text = "";
            }
        }



        private void button1_Click(object sender, EventArgs e)
        {
            Write();
        }

        private void serialPort1_DataReceived(object sender, SerialDataReceivedEventArgs e)
        {
            int n = serialPort1.BytesToRead;
            byte[] buf = new byte[n];
            string Temp = "";
            if (serialPort1.BytesToRead > 0)
            {                
                serialPort1.Read(buf, 0, n);
                Temp = System.Text.Encoding.ASCII.GetString(buf);

            }
            Reception_ListBox2.Items.Add("收到：" + Temp);
        }
    }
